SELECT COUNT(DISTINCT mulheresmil_1.calculation_838513981462429699) AS ctdcalculation_838513981462429699ok,   mulheresmil_1.no_modalidade AS no_modalidade,   mulheresmil_1.nome_curso_catalogo_guia AS nome_curso_catalogo_guia,   mulheresmil_1.nome_da_ue AS nome_da_ue,   mulheresmil_1.uf_do_local_da_oferta AS uf_do_local_da_oferta FROM mulheresmil_1 WHERE ((mulheresmil_1.no_modalidade = 'Pronatec Mulheres Mil') AND (mulheresmil_1.uf_do_local_da_oferta >= 'AC') AND (mulheresmil_1.uf_do_local_da_oferta <= 'TO') AND (NOT ((mulheresmil_1.nome_da_sit_matricula_situacao_detalhada IN ('AGUARD_CONF', 'CANC_DESISTENTE', 'CANC_MAT_PRIM_OPCAO', 'CANC_SANO', 'CANC_SEM_FREQ_INICIAL', 'CANC_TURMA', 'DOC_INSUFIC', 'ESCOL_INSUFIC', 'INC _ITINERARIO', 'INSC_CANC', 'NO_COMPARECEU', 'TURMA_CANC', 'VAGAS_INSUFIC')) OR (mulheresmil_1.nome_da_sit_matricula_situacao_detalhada IS NULL))) AND (NOT (mulheresmil_1.situacao_da_turma IN ('CANCELADA', 'CRIADA', 'PUBLICADA')))) GROUP BY no_modalidade, nome_curso_catalogo_guia, nome_da_ue, uf_do_local_da_oferta;
